import React from 'react';
import logo from 'https://www.lendified.com/wp-content/themes/lendified2017/dist/img/lendified-logo.png'

const Logo = props => {
    return (
        <div className="logo-container">
            <img src={logo} alt={props.alt}/>
        </div>
    )
}
export default Logo;
